import React from 'react';
import Text from "./Text";

function Buttons(props) {
    const style = {
        textAlign:"center"
    };
    return (
        <>
        <button style={style}>
            <Text text={"button"}></Text>
        </button>
        </>
    );
}

export default Buttons;
